INSERT INTO `cms_block` VALUES (1,'Footer Links','footer_links','\n<ul>\n    <li><a href=\"{{store direct_url=\"about-magento-demo-store\"}}\">About Us</a></li>\n    <li><a href=\"{{store direct_url=\"customer-service\"}}\">Customer Service</a></li>\n<li class=\"last privacy\"><a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy</a></li>\r\n</ul>','2016-05-30 08:34:38','2016-05-30 08:34:42',1),(2,'Footer Links Company','footer_links_company','\n<div class=\"links\">\n    <div class=\"block-title\">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href=\"{{store url=\"\"}}about-magento-demo-store/\">About Us</a></li>\n        <li><a href=\"{{store url=\"\"}}contacts/\">Contact Us</a></li>\n        <li><a href=\"{{store url=\"\"}}customer-service/\">Customer Service</a></li>\n        <li><a href=\"{{store url=\"\"}}privacy-policy-cookie-restriction-mode/\">Privacy Policy</a></li>\n    </ul>\n</div>','2016-05-30 08:34:41','2016-05-30 08:34:41',1),(3,'Cookie restriction notice','cookie_restriction_notice_block','<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>','2016-05-30 08:34:42','2016-05-30 08:34:42',1),(4,'cms-static-top-support','cms-static-top-support','<div class=\"cms-static-top-support hot-support\">\r\n<div class=\"hotline\">\r\n<p><span class=\"icon icon-phone\"><em class=\"hidden\">hidden</em></span>+060 (800) 801-858</p>\r\n</div>\r\n<div class=\"email\">\r\n<p><span class=\"icon icon-mail\"><em class=\"hidden\">hidden</em></span>info@electro.com</p>\r\n</div>\r\n</div>','2016-05-30 10:20:08','2016-10-18 07:30:20',1),(5,'cms-static-main-footer','cms-static-main-footer','<div class=\"main-footer\">\r\n<div class=\"conta