INSERT INTO `cms_page` VALUES (1,'404 Not Found 1','two_columns_right','Page keywords','Page description','no-route',NULL,'\n<div class=\"page-title\"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class=\"disc\">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class=\"disc\">\n            <li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a>\n            <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n','2016-05-30 08:34:39','2016-05-30 08:34:39',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(2,'Home page','one_column',NULL,NULL,'home',NULL,'<!-- banner -->\r\n<div class=\"cms-page-banner\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-4 box\">\r\n<div class=\"box-content\"><a href=\"#\"><img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/alothemes/static/demo1/banner_03.jpg\"}}\" alt=\"\" /></a> <a class=\"btn-shop\" href=\"#\">shop now</a></div>\r\n</div>\r\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-4 box\">\r\n<div class=\"box-content\"><a href=\"#\"><img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/alothemes/static/demo1/banner_05.jpg\"}}\" alt=\"\" /></a> <a class=\"btn-shop\" href=\"#\"><em class=\"hidden\">hidden</em></a></div>\r\n</div>\r\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-4 box\">\r\n<div class=\"box-content\"><a href=\"#\"><img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/alothemes/static/demo1/banner_07.jpg\"}}\" alt=\"\" /></a> <a class=\"btn-shop\" href=\"#\">shop now</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end banner -->\r\n<!-- main product -->\r\n<div class=\"cms-page-main-product main-product\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4 col-md-4 col-sm-12 col-xs-12 cms-page-countdown-product\">{{widget type=\"magicproduct/widget_magicproduct\" identifier=\"main-product-timer\" template=\"magiccart/magicproduct/magicproduct.phtml\"}}</div>\r\n<div class=\"col-lg-8 col-md-8 col-sm-12 col-xs-12 cms-page-mix-product\">{{widget type=\"magicproduct/widget_magicproduct\" identifier=\"main-product-01\" template=\"magiccart/magicproduct/magicproduct.phtml\"}}</div>\r\n</div>\r\n</div>\r\n<!-- end main product -->','2016-05-30 08:34:39','2016-10-18 07:32:27',1,0,'<!--<reference name=\"content\">\r\n        <block type=\"catalog/product_new\" name=\"home.catalog.product.new\" alias=\"product_new\" template=\"catalog/product/new.phtml\" after=\"cms_page\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_viewed\" name=\"home.reports.product.viewed\" alias=\"product_viewed\" template=\"reports/home_product_viewed.phtml\" after=\"product_new\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_compared\" name=\"home.reports.product.compared\" template=\"reports/home_product_compared.phtml\" after=\"product_viewed\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name=\"right\">\r\n        <action method=\"unsetChild\"><alias>right.reports.product.viewed</alias></action>\r\n        <action method=\"unsetChild\"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->',NULL,NULL,NULL,NULL,NULL),(3,'About Us','one_column',NULL,NULL,'about-magento-demo-store',NULL,'<div class=\"about-us-content content\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-12 box\">\r\n<div class=\"box-content\">\r\n<div class=\"img\"><a href=\"#\"><img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/alothemes/cms/about-img-1.jpg\"}}\" alt=\"\" /></a></div>\r\n<div class=\"subcribe\">\r\n<h3 class=\"title\">What we really do?</h3>\r\n<p class=\"text\">Donec libero dolor, tincidunt id laoreet vitae, ullamcorper eu tortor. Maecenas pellentesque, dui vitae iaculis mattis, tortor nisi faucibus magna, vitae ultrices lacus purus vitae metus.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-12 box\">\r\n<div class=\"box-content\">\r\n<div class=\"img\"><a href=\"#\"><img class=\"img-responsive\" src=\"{{media url=\"wysiwyg/alothemes/cms/about-img-2.jpg\"}}\" alt=\"\" /></a></div>\r\n<div class=\"subcribe\">\r\n<h3 class=\"title\">Our Version</h3>\r\n<p class=\"text\">Donec libero dolor, tincidunt id laoreet vitae, ullamcorper eu tortor. Maecenas pellentesque, dui vitae iaculis mattis, tortor nisi faucibus magna, vitae ultrices lacus purus vitae metus.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-12 box\">\r\n<div class=\"box-content\">\r\n<div class=\"img\"><a href=\"#\"><img class=\"img